import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ul> 
          <li>peace</li>
          <li>love</li>
          <li>understanding</li>
        </ul>
      </header>
    </div>
  );
}

export default App;
